// FILE: src/HomePage.js
import React, { useState, useEffect } from "react";
import axios from "axios";
import "./HomePage.css";

const HomePage = () => {
  const [products, setProducts] = useState([]);

  // Chatbox state
  const [chatOpen, setChatOpen] = useState(false);
  const [chatMessage, setChatMessage] = useState("");
  const [chatHistory, setChatHistory] = useState([]);
  const [loadingAI, setLoadingAI] = useState(false);

  useEffect(() => {
    loadProducts();
  }, []);

  const loadProducts = async () => {
    try {
      const res = await axios.get("http://localhost:5000/api/product/list");
      setProducts(res.data);
    } catch (error) {
      console.error(error);
    }
  };

  // üî• G·ª≠i tin nh·∫Øn t·ªõi API AI
  const sendChat = async () => {
    if (!chatMessage.trim()) return;

    const userMsg = { role: "user", content: chatMessage };

    setChatHistory([...chatHistory, userMsg]);
    setChatMessage("");
    setLoadingAI(true);

    try {
      const res = await axios.post("http://localhost:5000/api/ai/chat", {
        message: chatMessage,
      });

      const botMsg = {
        role: "assistant",
        content: res.data.reply,
      };

      setChatHistory((prev) => [...prev, botMsg]);
    } catch (error) {
      console.error(error);
    }

    setLoadingAI(false);
  };

  return (
    <div className="homepage-container">

      {/* Banner */}
      <div className="banner">
        <h1>Shop Qu·∫ßn √Åo Online</h1>
        <p>Khuy·∫øn m√£i ƒë·∫øn 50% t·∫•t c·∫£ s·∫£n ph·∫©m!</p>
      </div>

      {/* Danh s√°ch s·∫£n ph·∫©m */}
      <h2 className="title">S·∫£n ph·∫©m n·ªïi b·∫≠t</h2>

      <div className="products-grid">
        {products.map((p) => (
          <div className="product-card" key={p._id}>
            <img src={p.productImage} alt={p.productName} />
            <h3>{p.productName}</h3>
            <p className="price">{p.price}‚Ç´</p>

            <p className="desc">
              {p.description?.slice(0, 60)}...
            </p>

            <button className="buy-btn">Xem chi ti·∫øt</button>
          </div>
        ))}
      </div>

      {/* üî• Chatbox AI */}
      <div className={`chatbox ${chatOpen ? "open" : ""}`}>
        <div className="chat-header" onClick={() => setChatOpen(!chatOpen)}>
          <span>üí¨ H·ªó tr·ª£ AI</span>
        </div>

        {chatOpen && (
          <div className="chat-body">

            <div className="chat-history">
              {chatHistory.map((msg, i) => (
                <div
                  key={i}
                  className={`chat-message ${msg.role === "user" ? "user" : "bot"}`}
                >
                  {msg.content}
                </div>
              ))}

              {loadingAI && <div className="chat-message bot">ƒêang tr·∫£ l·ªùi...</div>}
            </div>

            <div className="chat-input">
              <input
                placeholder="Nh·∫≠p c√¢u h·ªèi..."
                value={chatMessage}
                onChange={(e) => setChatMessage(e.target.value)}
                onKeyDown={(e) => e.key === "Enter" && sendChat()}
              />
              <button onClick={sendChat}>G·ª≠i</button>
            </div>

          </div>
        )}
      </div>
    </div>
  );
};

export default HomePage;
